import React, { useEffect, useState } from "react";
import {
  Box,
  Grid,
  Typography,
  Paper,
  CircularProgress,
} from "@mui/material";
import './SensorAudioCollection'; // Ensure this file exists in the src/pages directory

export default function CameraVisualPage() {
  const [cameraResults, setCameraResults] = useState([]);
  const [isLoading, setIsLoading] = useState(false);

  // Fetch camera results
  const fetchCameraResults = async () => {
    setIsLoading(true);
    try {
      const response = await fetch('http://192.168.1.111:5000/camera-results');
      if (response.ok) {
        const results = await response.json();
        setCameraResults(results);
      } else {
        console.error('Failed to fetch camera results');
      }
    } catch (error) {
      console.error('Error fetching camera results:', error);
    } finally {
      setIsLoading(false);
    }
  };

  useEffect(() => {
    fetchCameraResults();
  }, []);

  return (
    <Grid
      container
      spacing={0}
      direction="column"
      alignItems="center"
      justify="center"
      style={{ minHeight: "100vh" }}
    >
      <Grid item xs={12} md={12}>
        <Paper elevation={3} className="results-section">
          <Typography variant="h5" gutterBottom>
            Camera Visual Data Collection
          </Typography>
          <Box
            className="camera-results"
            style={{
              padding: '10px',
              border: '1px solid #ccc',
              backgroundColor: '#f9f9f9',
            }}
          >
            {isLoading ? (
              <CircularProgress />
            ) : cameraResults.length > 0 ? (
              cameraResults.map((result, index) => (
                <Typography key={index} variant="body2">
                  {result}
                </Typography>
              ))
            ) : (
              <Typography variant="body2">No camera results available.</Typography>
            )}
          </Box>
        </Paper>
      </Grid>
    </Grid>
  );
}
